import React, { useState } from 'react';
import { Box, Card, Typography, CardActions, CardContent, Button, Modal } from '@mui/material';

const bull = (
  <Box
    component="span"
    sx={{ display: 'inline-block', mx: '2px', transform: 'scale(0.8)' }}
  >
    â€¢
  </Box>
);

const cardContent = (
  <React.Fragment>
    <CardContent>
      <Typography gutterBottom sx={{ color: 'text.secondary', fontSize: 14 }}>
        Essentials
      </Typography>
      <Typography variant="h5" component="div">
        Sofa
      </Typography>
      <Typography variant="body2" component="div">
        <img src="https://placehold.co/600x400" alt="Sofa" style={{ width: '100%', marginTop: '1em', marginBottom: '1em' }} />
      </Typography>
      <Typography variant="body2">
        A cozy, three-seater sofa with soft cushions, a sturdy frame, and plush fabric upholstery, perfect for relaxing or entertaining in any living space.
      </Typography>
    </CardContent>
    <CardActions>
      <Button size="small" onClick={() => setOpen(true)}>Learn More</Button>
    </CardActions>
  </React.Fragment>
);

const Store = () => {
  const [open, setOpen] = useState(false);

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <Box sx={{ width: '20%', margin: '20px' }}>
      <Typography variant="h4" component="div" gutterBottom>
        Store
      </Typography>
      <Card variant="outlined">{cardContent}</Card>

      {/* Modal */}
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box
          sx={{
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            width: 400,
            bgcolor: 'background.paper',
            border: '2px solid #000',
            boxShadow: 24,
            p: 4,
          }}
        >
          <Typography id="modal-modal-title" variant="h6" component="h2">
            Sofa Details
          </Typography>
          <Typography id="modal-modal-description" sx={{ mt: 2 }}>
            This is a premium sofa with luxurious comfort and a sleek design, perfect for any modern living space.
          </Typography>
        </Box>
      </Modal>
    </Box>
  );
};

export default Store;
